import React, {useState} from "react";
import RatingButton from "./RatingButton";
import Submit from "./Submit";


export default function Rate(){
    const [rating, setRating] = useState(0);

    function ratingButtonClickHandler(rating){
        setRating(rating);
    }

    return (<>
        {
            () => {
                for(let i = 1; i <= 5; i++){
                    return <RatingButton onClick={ratingButtonClickHandler} rating={i} currentRating={rating} />
                }
            }
        }
        {/* <RatingButton onClick={ratingButtonClickHandler} rating={2} currentRating={rating} /> */}
        {/* <RatingButton onClick={ratingButtonClickHandler} rating={3} currentRating={rating} /> */}
        {/* <RatingButton onClick={ratingButtonClickHandler} rating={4} currentRating={rating} /> */}
        {/* <RatingButton onClick={ratingButtonClickHandler} rating={1} currentRating={rating} /> */}
        {/* <RatingButton onClick={ratingButtonClickHandler} rating={5} currentRating={rating} /> */}
        <Submit currentRating={rating} />        
    </>)
}
